import React,{Fragment} from 'react'
import reactDom from 'react-dom'
import Login from './Login'

function DeadlineOverlay({handleCloseDeadlineOverlay}) {
    
    const portal = document.getElementById('portal')
    
    return reactDom.createPortal(
        <Fragment>
            <div onClick={handleCloseDeadlineOverlay} className='overlay-wrapper'></div>
            <Login handleCloseDeadlineOverlay={handleCloseDeadlineOverlay}/>
        </Fragment>
        ,portal)
}

export default DeadlineOverlay
